import { IgrStackedSplineSeries } from "./igr-stacked-spline-series";
import { Stacked100SplineSeries } from "./Stacked100SplineSeries";
/**
 * Represents a IgxDataChartComponent stacked100 spline series.
*/
export class IgrStacked100SplineSeries extends IgrStackedSplineSeries {
    createImplementation() {
        return new Stacked100SplineSeries();
    }
    /**
                                 * @hidden
                                 */
    get i() {
        return this._implementation;
    }
    constructor(props) {
        super(props);
    }
    get isPercentBased() {
        return this.i.aa4;
    }
}
